import React, { useState } from 'react'
import './App.css';
import Header from './components/Header';
import BenchmarkDataFilter from './components/BenchmarkDataFilter'
import { customTheme } from './components/customTemplate';
import { ThemeProvider } from '@material-ui/core/styles';
import { lightTheme, darkTheme, ToggleTheme as toggleTheme } from './components/themes.js';

class App extends React.Component {
  constructor(props){
  super(props);

  this.state = {
    selectedTheme: toggleTheme('Dark'),
    }
  }

  handleCallback = (data) =>{
    this.setState({selectedTheme: {...data}});
  }

  render() {
    return (
      <React.Fragment>
        <ThemeProvider theme={ this.state.selectedTheme }>

              <Header callback = {this.handleCallback}/>
              <BenchmarkDataFilter />    

        </ThemeProvider>
      </React.Fragment>
    );
  }
}

export default App;
